import{_ as e,o as i,c as a,O as t}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 13.1-1018.1 Change of principal office.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/13.1-1018.1.md","filePath":"vacode/13.1-1018.1.md"}'),o={name:"vacode/13.1-1018.1.md"},r=t('<h1 id="§-13-1-1018-1-change-of-principal-office" tabindex="-1">§ 13.1-1018.1 Change of principal office. <a class="header-anchor" href="#§-13-1-1018-1-change-of-principal-office" aria-label="Permalink to &quot;§ 13.1-1018.1 Change of principal office.&quot;">​</a></h1><p>A. A limited liability company or a foreign limited liability company registered pursuant to Article 10 (§ <a href="http://law.lis.virginia.gov/vacode/13.1-1051/" target="_blank" rel="noreferrer">13.1-1051</a> et seq.) may change its principal office upon filing in the office of the Commission a statement of change on a form supplied by the Commission that sets forth:</p><ol><li><p>The name of the limited liability company or foreign limited liability company;</p></li><li><p>The address of its current principal office; and</p></li><li><p>The post office address, including the street and number, if any, of the new principal office.</p></li></ol><p>B. A statement of change shall forthwith be delivered to the Commission for filing by a domestic limited liability company or a foreign limited liability company registered pursuant to Article 10 (§ <a href="http://law.lis.virginia.gov/vacode/13.1-1051/" target="_blank" rel="noreferrer">13.1-1051</a> et seq.) whenever the address of its principal office ceases to be the office at which the principal executive offices of the domestic or foreign limited liability company are located.</p><p>2009, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0450" target="_blank" rel="noreferrer">450</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0288" target="_blank" rel="noreferrer">288</a>.</p>',5),n=[r];function l(c,f,p,s,h,d){return i(),a("div",null,n)}const _=e(o,[["render",l]]);export{g as __pageData,_ as default};
